import { gql } from '@apollo/client';

const Map = {
    saveMap: gql(`
                mutation saveMap($username: String!, $map: [SquareObject!]) {
                    saveMap(username: $username, map: $map){
                        response_type,
                        response
                    }
                },
            `),
    getUserMaps: gql(`
                query getUsersMaps($username: String!) {
                    getUserMaps(username: $username){
                        map,
                        highscore_one,
                        highscore_two,
                        highscore_three
                    }
                },
            `),
}

export default Map;
